  CONSTRAINT `orders_ibfk_3` FOREIGN KEY (`buyerID`) REFERENCES `buyer` (`buyerID`) ON DELETE SET NULL,
  CONSTRAINT `orders_chk_1` CHECK ((`deliveryTime` > `orderTime`)),
